const linkit = {
  display: "flex",
  justifyContent: "center",
  alignItems: "center"
}

function App() {
  return (
    <div>
       <a style={{fontSize: "100px", padding: "50px"}} href="https://www.linkedin.com/in/matias-haapasalmi/">
              <BsLinkedin/>
            </a>
      <a style={{fontSize: "100px", padding: "50px"}} href="https://github.com/matiashaapasalmi">
              <BsGithub/>
      </a>


    </div>
  );
}

export default App;
